import  { useState,useEffect} from 'react';
import { CartForm } from './components/cart-form/cart-form';
import {Cart} from './components/cart/Cart';
import {CartState} from './components/store/CartState';
import {CartList} from './components/Cart-list/CartList'
import {Routes,Route, Link, useNavigate} from 'react-router-dom';
function App() {

  let navigate= useNavigate()
  return (

    <div className='App' >

      <nav>
        <ul>
          <li><Link to='/'> Product List</Link></li>
          <li><Link to='/add'> Add Product</Link></li>

        </ul>
      </nav>
      <button onClick={()=>navigate('/add')}>Go to add Product</button>
      <CartState>
        <Routes>
            <Route path='/' element={<CartList/>}></Route>
            <Route path='/add' element={<CartForm />}></Route>

        </Routes>
      </CartState>
    </div>

  );
}

export default App;
